import React, { useState } from "react";
import { Link } from "react-router-dom";

function LoginPage() {
    const [formData, setFormData] = useState({
        email: "",
        profession: "Admin",
        password: "",
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Form submitted:", formData);
        // Vous pouvez appeler une API ici pour gérer la connexion
    };

    return (
        <div style={styles.page}>
            <h1>Login</h1>
            <p>Connectez-vous pour accéder à vos données et gérer vos informations personnelles.</p>

            <form onSubmit={handleSubmit} style={styles.form}>
                {/* Email Field */}
                <div style={styles.formGroup}>
                    <label htmlFor="email" style={styles.label}>Email :</label>
                    <input
                        type="email"
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        required
                        style={styles.input}
                    />
                </div>

                {/* Profession Field */}
                <div style={styles.formGroup}>
                    <label htmlFor="profession" style={styles.label}>Profession :</label>
                    <select
                        id="profession"
                        name="profession"
                        value={formData.profession}
                        onChange={handleChange}
                        required
                        style={styles.select}
                    >
                        <option value="Admin">Admin</option>
                        <option value="Doctor">Doctor</option>
                        <option value="Patient">Patient</option>
                    </select>
                </div>

                {/* Password Field */}
                <div style={styles.formGroup}>
                    <label htmlFor="password" style={styles.label}>Mot de passe :</label>
                    <input
                        type="password"
                        id="password"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                        required
                        style={styles.input}
                    />
                </div>

                {/* Links */}
                <div style={styles.links}>
                    <Link to="/forgot-password" style={styles.link}>Mot de passe oublié ?</Link>
                    <Link to="/signup" style={styles.link}>Créer un compte</Link>
                </div>

                {/* Submit Button */}
                <button type="submit" style={styles.button}>Se connecter</button>
            </form>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
    form: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        maxWidth: "400px",
        margin: "0 auto",
    },
    formGroup: {
        marginBottom: "20px",
        width: "100%",
    },
    label: {
        display: "block",
        marginBottom: "5px",
        fontSize: "16px",
        fontWeight: "bold",
    },
    input: {
        width: "100%",
        padding: "10px",
        fontSize: "16px",
        borderRadius: "5px",
        border: "1px solid #ccc",
    },
    select: {
        width: "100%",
        padding: "10px",
        fontSize: "16px",
        borderRadius: "5px",
        border: "1px solid #ccc",
    },
    links: {
        display: "flex",
        justifyContent: "space-between",
        width: "100%",
        marginBottom: "20px",
    },
    link: {
        textDecoration: "none",
        fontSize: "14px",
        color: "#007bff",
    },
    button: {
        padding: "10px 20px",
        fontSize: "16px",
        color: "white",
        backgroundColor: "#007bff",
        border: "none",
        borderRadius: "5px",
        cursor: "pointer",
    },
};

export default LoginPage;
